import styled from "styled-components";

export const StyledProjectTile = styled.img`
	flex-shrink: 0;
	height: 35.56vh;
	width: 35.56vh;
	box-shadow: 0px 0px 1vh rgba(0, 0, 0, 0.4);
	margin-left: 1.33%;
`

export const StyledAllProjects = styled.a`
	display: grid;
	grid-template-columns: 1fr 0.5vh 1fr;
	grid-template-rows: 1fr 0.5vh 1fr;
	grid-template-areas: 
		'one . two'
		'.   .   .'
		'three . four';
	flex-shrink: 0;
	margin-left: 8vh;
	margin-right: 7.9vw;
	height: 22.2vh;
	width: 22.2vh;
	background-color: #505050;
	box-shadow: 0px 0px 1vh rgba(0, 0, 0, 0.4);
  border-radius: 50%;
`

export const SquareOne = styled.div`
	justify-self: end;
	align-self: end;
	height: 2.78vh;
	width: 2.78vh;
	border: 0.6vh solid #dcdcdc;
	grid-area: one;
`

export const SquareTwo = styled.div`
	align-self: end;
	height: 2.78vh;
	width: 2.78vh;
	border: 0.6vh solid #dcdcdc;
	grid-area: two;
`

export const SquareThree = styled.div`
	justify-self: end;
	height: 2.78vh;
	width: 2.78vh;
	border: 0.6vh solid #dcdcdc;
	grid-area: three;
`

export const SquareFour = styled.div`
	height: 2.78vh;
	width: 2.78vh;
	border: 0.6vh solid #dcdcdc;
	grid-area: four;
`
